import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { AddBookComponent } from './add-book/add-book.component';
import { DeleteBookComponent } from './delete-book/delete-book.component';
import { MOdifyBookComponent } from './modify-book/modify-book.component';
import { ViewABookComponent } from './view-abook/view-abook.component';
import { ViewAllBooksComponent } from './view-all-books/view-all-books.component';
import { AddComponent } from './add/add.component';
import { DeleteComponent } from './delete/delete.component';
import { ModifyComponent } from './modify/modify.component';
import { ViewComponent } from './view/view.component';
import { ViewAllComponent } from './view-all/view-all.component';

const routes: Routes = [
  {path:'',component:AddBookComponent},
  {path:'AddBook',component:AddBookComponent},
  {path:'DeleteBook',component:DeleteBookComponent},
  {path:'ModifyBook',component:MOdifyBookComponent},
  {path:'ViewABook',component:ViewABookComponent},
  {path:'ViewAllBook',component:ViewAllBooksComponent},
  {path:'add',component:AddComponent},
  {path:'delete',component:DeleteComponent},
  {path:'modify',component:ModifyComponent},
  {path:'view',component:ViewComponent},
  {path:'viewall',component:ViewAllComponent}


];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
